import React, { Component } from "react";
import { Row, Col } from "antd";

export default class Intro extends Component {
  render() {
    return (
      <Row
        type="flex"
        justify="center"
        align="middle"
        style={{ minHeight: "100vh" }}
      >
        <h4>DL 1961</h4>
      </Row>
    );
  }
}
